import React from "react";
import { CssBaseline } from "@material-ui/core";
import Container from '@material-ui/core/Container';
import wallpaper from "../components/images/wallpaper.jpeg";
import Button from '@material-ui/core/Button';
import './Home.css';

const Home = () => {

  return (
    <React.Fragment>
      <CssBaseline />
      <div className="homeContainer">
        <img src={wallpaper} alt="Wallpaper" className="homeImage" />
        <Container maxWidth="lg" className="homeText">
          <h3 className="homeTextName">Hey you..</h3>
          <h3 className="homeTextTitle">Wagging tails will never disappoint</h3>
          <Button>Create Account</Button>
        </Container>
      </div>
    </React.Fragment>
  );
}

export default Home;
